import "./ExpenseItemDate.css";

function ExpenseItemDate(props) {
  return (
    <div className="expense_item__date">
      <div className="expense_item__date__month">{props.month}</div>
      <div className="expense_item__date__year">{props.year}</div>
      <div className="expense_item__date__day">{props.day}</div>
    </div>
  );
}

export default ExpenseItemDate;
